class Banco{constructor(){this.clientes=[],this.proximoId=1}cadastrarCliente(o,e){e={id:this.proximoId++,nome:o,saldo:e};this.clientes.push(e),console.log(`Cliente ${o} foi cadastrado com sucesso no banco Turma1132_Bank`)}consultarSaldo(e){var o=this.clientes.find(o=>o.id===e);return o?(console.log(`Saldo do cliente ${o.id} (${o.nome}): `+o.saldo),o.saldo):(console.error(`Cliente com ID ${e} nao foi encontrado!`),-1)}depositar(e,o){var a=this.clientes.find(o=>o.id===e);a?(a.saldo+=o,console.log(`Deposito no valor de ${o} foi realizado para o cliente ${a.id} (${a.nome})`)):console.error(`Cliente com ID ${e} nao foi encontrado. 
        O deposito nao pode ser realizado!`)}sacar(e,o){var a=this.clientes.find(o=>o.id===e);a?a.saldo>=o?(a.saldo-=o,console.log(`Saque de ${o} foi realizado para o cliente ${a.id} (${a.nome})`)):console.error(`Saldo insuficiente para o cliente ${a.id} (${a.nome})`):console.error(`Cliente com ID ${e} nao foi encontrado. 
        O saque nao pode ser realizado!`)}}export{Banco};